	<body>
		<script>
		
			var width  = 1280;
			var height = 720;
		
			var w = width>>3;
			var h = height>>3;
			
			var img = [new Image(),new Image()];
			var loaded = 0;
			var onLoad = function() { 
				if(img.length==++loaded) onComplete(); 
			}			
			for(var k=0; k<img.length; k++) img[k].onload = onLoad;
			img[0].src = "01.png";
			img[1].src = "02.png";			
			
			var dst = document.createElement("canvas");
			dst.width  = width;
			dst.height = height;
			
			var preview = document.createElement("canvas");
			preview.width  = width;
			preview.height = height;
			document.body.appendChild(preview);
			
			var bypass = document.createElement("canvas");
			bypass.width  = width;
			bypass.height = height;
			document.body.appendChild(bypass);
			
			
			var CODE = {
				INTER_NO_MV:0,
				INTRA:1,
				INTER_PLUS_MV:2,
				INTER_LAST_MV:3
			};
			
			var onComplete = function() {
				
				var last = document.createElement("canvas");
				last.width  = width;
				last.height = height;
				last.getContext("2d").drawImage(img[0],0,0);
				
				var context = dst.getContext("2d");

				var decode = function(i,j) {
					
					var i2 = i<<3; 
					var j2 = j<<3; 
						
					var addr = i*w+j;
					var tmp = data[addr];
						
					if((tmp&0xFF)>=CODE.INTER_PLUS_MV) {	
												
						var vx = (((tmp>> 8)&0xFF)-128)*0.5;
						var vy = (((tmp>>16)&0xFF)-128)*0.5;
						
						context.drawImage(last,
							j2+vx,i2+vy,8,8, 
							j2,i2,8,8
						);
							
						return true;
					}
					
					return false;	
				}		

				context.drawImage(last,0,0);	
				
					var cnt = 0; 			
					var tid = setInterval(function() {		
					
						for(var k=0; k<10; k++) {
							if(cnt<w*h) {		
								while(true) {
									var ret = decode((cnt/w)>>0,cnt%w);
									if(++cnt>=w*h) {
										clearInterval(tid)
										break;
									}
									if(ret) break;
								}
							}
						}
								
					},1000/120)
				
					var frame = true;

					setInterval(function() {	
							
						frame = !frame;
													
						if(frame) {
							preview.getContext("2d").drawImage(dst,0,0);
							bypass.getContext("2d").drawImage(img[0],0,0);
						}
						else {
							preview.getContext("2d").drawImage(img[1],0,0);
							bypass.getContext("2d").drawImage(img[1],0,0);
						}
						
					},1000/8)	
				}
